import './App.css';
//import Information from './components/Info/Info';
import Information1  from './components/Info1/Info';
import Information2  from './components/Info2/Info';
import Information3  from './components/Info3/Info';
import Threejs from './components/Threejs.js'
import Gallery from './components/Gallery/Gallery';

function App() {
  return (
    <div className="App">
      <Information1
      heading = "Who we are"
      text = "It's easy to create a standard: it's a precautionary measure, a safety valve, a shield against devastating, subversive genius. Art however is an invincible force. It opens up your inner self completely, because creativity nurtures the soul."
      />;
      <Information1
      heading = "Our Beliefs"
      text = "We believe in creative thinking and the power of exploration, in going beyond our restrictive habits by tearing apart everything that is taken for granted and taught as absolute truth."
      />

      <Gallery/>
      <Threejs/>
    </div>
  );
}

export default App;
